(18, 73, 'Iran', '', '', '', '', 'Iran is a country in Western Asia. It is bordered to the northwest by Armenia and Azerbaijan, to the north by the Caspian Sea, to the northeast by Turkmenistan, to the east by Afghanistan and Pakistan, to the south by the Persian Gulf and the Gulf of Oman, and to the west by Turkey and Iraq.', '', 'IR', 'IRN', '', '32.427908', '53.688046', '', '', '', '', NULL, '', '', '', '', 1, '2021-03-25 19:26:45', '2021-03-25 19:26:45');
